import React, { Component } from 'react';

class Feedback extends Component {
  render() {
    return (
      <div>
        <div>
          <h1>Nome do jogador</h1>
          <img alt="avatar" src="https://www.com.br" />
          <p>Pontuação</p>
        </div>
      </div>
    );
  }
}

export default Feedback;
